export default function MailForm() {
  return (
    <form className="grid gap-2 mt-7" action="#" noValidate>
      <label className="text-[0.6875rem] font-bold tracking-wider" htmlFor="mailForm">Email address</label>
      <input className="border border-[#9294a0] rounded-lg py-[0.9375rem] pl-6 placeholder:text-[0.9375rem] placeholder:tracking-wide" type="email" name="mailForm" id="mailForm" placeholder="email@company.com" />
      <input className="bg-[#242742] text-white font-bold mt-4 rounded-lg pt-[1.0625rem]" type="submit" value="Subscribe to monthly newsletter" />
    </form>
  );
}
